import React from "react";
import "./Content.css";

function Content({ contents }) {
  return (
    <div>
      {contents.map((content) => {
        <li className="content" id={content.id}>
          <div className="content__name">{content.username}ㅗ</div>
          <div className="content__title">{content.title}</div>
          <div className="content__createdAt">{content.creatAt}</div>
        </li>;
      })}
    </div>
  );
}

export default Content;
